(window.webpackJsonp=window.webpackJsonp||[]).push([[5],{80:function(a){a.exports=JSON.parse('{"metadata":{"timed":false,"story ID":"5aa4095a-b737-47d8-b5f2-b3b01d351054","title":{"_default":"Maylu Pirana"},"media":{"audio":"","video":""},"languages":[],"date_created":"","date_uploaded":"1/25/2026","source":{"_default":""},"description":"“Antiguamente, los gallinazos eran humanos”. Los gallinazos conocían el fuego, pero el lorito Pedrillo les robó su candela y la tiró en un árbol grande, seco. Un mitayero escuchó la candela. Y llevó la candela a su familia, para cocinar. Camino a casa, cada vez que la candela, olvidaba el nombre de la candela. Pero cuando sus hijos lo vieron con la candela, la reconocieron y sabían cómo se llamaba.","genre":"","author":"Yine","glosser":"","speakers":["Rittma Urquía"],"xml_file_name":"Maylu Pirana.eaf","source_filetype":"ELAN","tier IDs":{"Transcripción":{"subdivided":false},"Traducción":{"subdivided":false}},"speaker IDs":{"S1":{"name":"Rittma Urquía","tier":"Transcripción"}},"narration":"Ritma Urquía","translation":"Ritma Urquía"},"sentences":[{"speaker":"S1","tier":"Transcripción","start_time_ms":470,"end_time_ms":4660,"num_slots":1,"text":"Muchikaygima maylunni yinkakgimananitkani.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"Antiguamente, los gallinazos eran humanos."}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":4980,"end_time_ms":7730,"num_slots":1,"text":"Wanna gapka gimnitkana kapawalenni.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"Ellos primero conocieron el fuego."}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":7959,"end_time_ms":15129,"num_slots":1,"text":"Yagini pagoni gimatka, xripigima wa chowgu mtianatkanu wagipawna.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"Un día, vino un lorito de pico negro a robarles sus candelas. "}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":16447,"end_time_ms":30145,"num_slots":1,"text":"Waneklu gima maylunitka wagerotgima nikanatanatkana gi gima wa gipnachri  jimkaluru nikanatatkana wa xripi gimni wa chowgumtyana wa chichmero. ","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"Desde esa vez, los gallinazos comieron carne cruda, ya no asada. El lorito pedrillo es el que les robó su candela. "}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":31010,"end_time_ms":48343,"num_slots":1,"text":"Giyagnimatkani wa xripitka satu wa gagmuna tsru gagmungitsrukananu wa giprigachrinatka wane gima wa tkaspukmeromtlu wa chichmero, wale gima gakpa gatka.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"Entonces, el lorito pedrillo soltó la candela en un árbol grande, seco. Ahí soltó su candela y eso empezó a arder. "}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":50260,"end_time_ms":58740,"num_slots":1,"text":"Wa pagonimatkani satu kgiyolikaklergima wa giyolika jemgimamtlu wa chichmero.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"Un día, un mitayero se fue a cazar y escuchó la candela. "}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":60027,"end_time_ms":66532,"num_slots":1,"text":" Chijjj chij chijj chi chijj chingimanata.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"Sonaba chijjj, chij, chij."}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":67054,"end_time_ms":73299,"num_slots":1,"text":"Ya klunernige chingimata wane gima yatka rontapgimata. Kakmrukmerlegimatanaralga gimatana. ","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"“¿Qué será?”, dijo el hombre, quien se acercó a mirar. Tocó la candela y se quemó bien fuerte. "}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":73870,"end_time_ms":77070,"num_slots":1,"text":"Gaa tyetkani ga chijj chingimata.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"“¡Ah! Esto es lo que suena así”, dijo. "}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":77340,"end_time_ms":84450,"num_slots":1,"text":"Chichi ktani chingimata gimakgimakni china gimatyawaka wale gimaki giwakatlu chichi. ","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"“Entonces, su nombre es chichi”, dijo el hombre. A lo que sonaba le puso el nombre de “chichi”. "}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":84727,"end_time_ms":88025,"num_slots":1,"text":"Chichmero giyagni chichmeroktani chingimata.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"Entonces, el hombre dijo que eso era la candela. "}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":88357,"end_time_ms":99954,"num_slots":1,"text":"Giyagni satokatka wale gima gike gimatka wa waletka wa ruyolikgimatatka klujta mchira gimni chkotungimni wa rutjita. ","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"Luego, él regresó, pero a buscar presas, presas. Ya había matado maquisapas y monos. "}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":102672,"end_time_ms":108163,"num_slots":1,"text":"Koshpagimatlo wa mchiranshigima rustaka tonshi gima yagotjimlegimatlo.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"Entonces, sacó un pedazo de su rabo de la maquisapa para probar si se le podía cocinar. "}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":109131,"end_time_ms":118016,"num_slots":1,"text":"Wane gima rawyatkalu nikgimatlu ponikotaa rixa ga kigleruktani watye chichi nanikanutkalu nomole nyegi chingimata ranikmergimatatkalu. ","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"De ahí la cogió, la comió y la probó. Se dio cuenta que estaba muy rico. “Está muy bueno, ahora voy a llevar para mi familia” dijo. Así, se llevó la candela. "}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":118344,"end_time_ms":123377,"num_slots":1,"text":"Rutspegimtapana ramtaklewgimamtanatnaka walegimako satokanatatnaka.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"Así, llevó la candela. Cuando estaba caminando, se tropezó y olvidó el nombre de la candela. Se paró para recogerla nuevamente. "}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":123729,"end_time_ms":129791,"num_slots":1,"text":"Wane gima rawapmerotatnaka jemgimatatnaklu chichi chichi chichi chichjjj. ","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"De nuevo, trajo la candela y escuchó “chichi, chichi, chjj”."}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":130302,"end_time_ms":139489,"num_slots":1,"text":"Rasukgimananumtatnaka chichi chichi chichi ralgimamtaatnaka rutspegimamtaatnakara gimamtyatnakgigima. ","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"Nuevamente, cuando regresaba corriendo y diciendo chichi, se cayó y se olvidó del nombre. "}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":139645,"end_time_ms":143718,"num_slots":1,"text":"Wale gimako satokanatatnaka kayitgimatanatka.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"Nuevamente, volvió. Ya se le había hecho tarde. "}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":143958,"end_time_ms":150458,"num_slots":1,"text":"Giyangimi wane gima china gaa giwanepotunanni giwa tyekatpje nwapanutkalu chingimata. ","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"Entonces dijo: “esta será la última vez que la voy a traer”. Eso dijo. "}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":150999,"end_time_ms":155812,"num_slots":1,"text":"Wale gimajo gwapatnaklu chicmero raskujimamta sato kgimatatnaka chichi chichi chichi. ","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"Otra vez se fue a traer corriendo la candela. Regresó nuevamente diciendo “chichi, chichi, chichi”. "}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":155854,"end_time_ms":159239,"num_slots":1,"text":"Kaspuklewgimamtanatka wane gima retyatkana wugenene. ","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"Nuevamente, soltó la candela. Cuando se levantó, vió a sus hijos. "}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":159520,"end_time_ms":166697,"num_slots":1,"text":"Makgimakta ¡Gaa papá chichmerotka ranikapka chingimata! gaga wale giwakno rushigkapgimatkoxatkalu wale. ","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"Ellos sabían el nombre  de la candela. “¡Ahh, papá está trayendo candela!”, dijeron. “¡Ahh, ese es el nombre!”, dijo el papá recordándolo en ese momento. "}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":167187,"end_time_ms":172343,"num_slots":1,"text":"Walekni chichmero chingimata giyagni wane gima yoshikyatkaluna.","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"“Ese es el nombre”, dijo. Entonces, todos pudieron hacer una fogata. "}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":172864,"end_time_ms":176249,"num_slots":1,"text":"Wa yagotgimatatkaluna. \\n","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"Así la probaron. "}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":176416,"end_time_ms":183645,"num_slots":1,"text":"Wa satu kayinre gima wa jimatkana punikpotgimlu waneklu gima rumtatkaluna yine wa chichmero. ","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"Entonces, asaron una de las presas que trajo el hombre y se las comieron. Estaba muy rico. Desde ahí, los yine conocieron la candela. "}]}]},{"speaker":"S1","tier":"Transcripción","start_time_ms":184437,"end_time_ms":188364,"num_slots":1,"text":"Wanepje nshi nika walepje. ","dependents":[{"tier":"Traducción","values":[{"start_slot":0,"end_slot":1,"value":"Eso no más me acuerdo. Gracias."}]}]}]}')}}]);